INSERT INTO `publication_generale` (`dtype`, `id_publication`, `date_publication`, `description`, `visibility`, `score`, `titre`, `vue`, `user_id`, `publication_initiale_id_publication`) VALUES
('PublicationInitiale', 1, '2024-05-08 03:47:31.000000', '\nThis question\'s answers are a community effort. Edit existing answers to improve this post. It is not currently accepting new answers or interactions.\nWhat are Null Pointer Exceptions (java.lang.NullPointerException) and what causes them?\n\nWhat methods/tools can be used to determine the cause so that you stop the exception from causing the program to terminate prematurely?', b'1', 5090, 'What is a NullPointerException, and how do I fix it?', 23, 1, NULL),
('ReponsePublication', 2, '2024-05-08 03:48:38.000000', 'There are two overarching types of variables in Java:\n\nPrimitives: variables that contain data. If you want to manipulate the data in a primitive variable you can manipulate that variable directly. By convention primitive types start with a lowercase letter. For example variables of type int or char are primitives.\n\nReferences: variables that contain the memory address of an Object i.e. variables that refer to an Object. If you want to manipulate the Object that a reference variable refers to you must dereference it. Dereferencing usually entails using . to access a method or field, or using [ to index an array. By convention reference types are usually denoted with a type that starts in uppercase. For example variables of type Object are references.\n\nConsider the following code where you declare a variable of primitive type int and don\'t initialize it:\n\nint x;\nint y = x + x;\nThese two lines will crash the program because no value is specified for x and we are trying to use x\'s value to specify y. All primitives have to be initialized to a usable value before they are manipulated.\n\nNow here is where things get interesting. Reference variables can be set to null which means \"I am referencing nothing\". You can get a null value in a reference variable if you explicitly set it that way, or a reference variable is uninitialized and the compiler does not catch it (Java will automatically set the variable to null).\n\nIf a reference variable is set to null either explicitly by you or through Java automatically, and you attempt to dereference it you get a NullPointerException.\n\nThe NullPointerException (NPE) typically occurs when you declare a variable but did not create an object and assign it to the variable before trying to use the contents of the variable. So you have a reference to something that does not actually exist.\n\nTake the following code:\n\nInteger num;\nnum = new Integer(10);\nThe first line declares a variable named num, but it does not actually contain a reference value yet. Since you have not yet said what to point to, Java sets it to null.\n\nIn the second line, the new keyword is used to instantiate (or create) an object of type Integer, and the reference variable num is assigned to that Integer object.\n\nIf you attempt to dereference num before creating the object you get a NullPointerException. In the most trivial cases, the compiler will catch the problem and let you know that \"num may not have been initialized,\" but sometimes you may write code that does not directly create the object.\n\nFor instance, you may have a method as follows:\n\npublic void doSomething(SomeObject obj) {\n   // Do something to obj, assumes obj is not null\n   obj.myMethod();\n}\nIn which case, you are not creating the object obj, but rather assuming that it was created before the doSomething() method was called. Note, it is possible to call the method like this:\n\ndoSomething(null);\nIn which case, obj is null, and the statement obj.myMethod() will throw a NullPointerException.\n\nIf the method is intended to do something to the passed-in object as the above method does, it is appropriate to throw the NullPointerException because it\'s a programmer error and the programmer will need that information for debugging purposes.\n\nIn addition to NullPointerExceptions thrown as a result of the method\'s logic, you can also check the method arguments for null values and throw NPEs explicitly by adding something like the following near the beginning of a method:\n\n// Throws an NPE with a custom error message if obj is null\nObjects.requireNonNull(obj, \"obj must not be null\");\nNote that it\'s helpful to say in your error message clearly which object cannot be null. The advantage of validating this is that 1) you can return your own clearer error messages and 2) for the rest of the method you know that unless obj is reassigned, it is not null and can be dereferenced safely.\n\nAlternatively, there may be cases where the purpose of the method is not solely to operate on the passed in object, and therefore a null parameter may be acceptable. In this case, you would need to check for a null parameter and behave differently. You should also explain this in the documentation. For example, doSomething() could be written as:\n\n/**\n  * @param obj An optional foo for ____. May be null, in which case\n  *  the result will be ____.\n  */\npublic void doSomething(SomeObject obj) {\n    if(obj == null) {\n       // Do something\n    } else {\n       // Do something else\n    }\n}\nFinally, How to pinpoint the exception & cause using Stack Trace\n\nWhat methods/tools can be used to determine the cause so that you stop the exception from causing the program to terminate prematurely?\n\nSonar with find bugs can detect NPE. Can sonar catch null pointer exceptions caused by JVM Dynamically\n\nNow Java 14 has added a new language feature to show the root cause of NullPointerException. This language feature has been part of SAP commercial JVM since 2006.\n\nIn Java 14, the following is a sample NullPointerException Exception message:\n\nin thread \"main\" java.lang.NullPointerException: Cannot invoke \"java.util.List.size()\" because \"list\" is null\n\nList of situations that cause a NullPointerException to occur\nHere are all the situations in which a NullPointerException occurs, that are directly* mentioned by the Java Language Specification:\n\nAccessing (i.e. getting or setting) an instance field of a null reference. (static fields don\'t count!)\nCalling an instance method of a null reference. (static methods don\'t count!)\nthrow null;\nAccessing elements of a null array.\nSynchronising on null - synchronized (someNullReference) { ... }\nAny integer/floating point operator can throw a NullPointerException if one of its operands is a boxed null reference\nAn unboxing conversion throws a NullPointerException if the boxed value is null.\nCalling super on a null reference throws a NullPointerException. If you are confused, this is talking about qualified superclass constructor invocations:\nclass Outer {\n    class Inner {}\n}\nclass ChildOfInner extends Outer.Inner {\n    ChildOfInner(Outer o) { \n        o.super(); // if o is null, NPE gets thrown\n    }\n}\nUsing a for (element : iterable) loop to loop through a null collection/array.\n\nswitch (foo) { ... } (whether its an expression or statement) can throw a NullPointerException when foo is null.\n\nfoo.new SomeInnerClass() throws a NullPointerException when foo is null.\n\nMethod references of the form name1::name2 or primaryExpression::name throws a NullPointerException when evaluated when name1 or primaryExpression evaluates to null.\n\na note from the JLS here says that, someInstance.someStaticMethod() doesn\'t throw an NPE, because someStaticMethod is static, but someInstance::someStaticMethod still throw an NPE!', b'1', NULL, NULL, NULL, 2, 1),
('ReponsePublication', 3, '2024-05-08 03:49:20.000000', '\"The best way to avoid this type of exception is to always check for null when you did not create the object yourself.\" If the caller passes null, but null is not a valid argument for the method, then it\'s correct to throw the exception back at the caller because it\'s the caller\'s fault. Silently ignoring invalid input and doing nothing in the method is extremely poor advice because it hides the problem. ', b'1', NULL, NULL, NULL, 1, 1),
('ReponsePublication', 5, '2024-05-08 03:55:56.000000', 'I would add a remark about this post explaining that even assignments to primitives can cause NPEs when using autoboxing: int a=b can throw an NPE if b is an Integer. There are cases where this is confusing to debug', b'1', NULL, NULL, NULL, 2, 1),
('ReponsePublication', 6, '2024-05-08 03:56:48.000000', 'Is it possible to capture NPE thrown by a webapp from the web browser?like will it show in the view page source from the web browser', b'1', NULL, NULL, NULL, 1, 1),
('ReponsePublication', 7, '2024-05-08 03:57:12.000000', 'Yes check if the object equals null before you invoke a method on it or try to access a variable it might have. Some times structuring your code can help avoid null pointer exception. eg when checking an input string with a constant string you should start with the constant string like here: if (\"SomeString\".equals(inputString)) {} //even if inputString is null no exception is thrown. So there are a bunch of things that you can do to try to be safe.', b'1', NULL, NULL, NULL, 2, 1),
('ReponsePublication', 8, '2024-05-08 03:59:07.000000', 'stop asking stupid questions !!! ', b'1', NULL, NULL, NULL, 3, 1),
('PublicationInitiale', 9, '2024-05-08 04:01:34.000000', 'am trying to write an error log which will store down all errors into a .txt file. But right now, the problem im facing is \"Directory Not Found Exception\"', b'1', 5070, 'Directory not found exception', 20, 3, NULL),
('ReponsePublication', 10, '2024-05-08 04:03:49.000000', 't\'s not quite clear how you are trying to use the \'path\' and \'Errorlog\' variables. It looks like you are trying to create a file using the directory path.\n\nYou\'ll need to ensure that the base path for your log file exists before you create the file. Is this close to what you are looking for?', b'1', NULL, NULL, NULL, 1, 9),
('ReponsePublication', 11, '2024-05-08 04:05:18.000000', 'Your path is a directory (string path = System.AppDomain.CurrentDomain.BaseDirectory.ToString()), but you use it as a File (File.Exists(path))?\n\nMaybe you should define path as something like this:\n\nstring path = Path.Combine(System.AppDomain.CurrentDomain.BaseDirectory, Errorlog)\nif Errorlog is your filename (e.g., \"xys.txt\")', b'1', NULL, NULL, NULL, 2, 9),
('PublicationInitiale', 12, '2024-05-08 04:07:47.000000', 'I made a cron to execute a task every tuesday at 3:50 AM - except a tuesday which coincides with the first day of the month:\n\n50 3 * * 2 MyCommand\nbut I don\'t know how I can translate my exception into the cron syntax, any tips?', b'1', 2020, 'special cron expression: how to make an exception?', 4, 1, NULL),
('ReponsePublication', 13, '2024-05-08 04:09:26.000000', 'Can you put a conditional in your script? I would do that. And in your cron you can comment that it won\'t run on the first per your script directions\n\nAs an example, in bash you can do this:\n\n#!/bin/bash\n\ndayofmonth=`date +\"%d\"`\nif [ $dayofmonth == \"01\" ];\nthen\n# do not run, exit\nexit\nfi\n\n# otherwise go on\necho \"it is not the first\"\nSo your cron would be\n\n30 5 * * 2 /path/to/script # comment: script conditional in place to not run on the 1st', b'1', NULL, NULL, NULL, 2, 12),
('ReponsePublication', 14, '2024-05-08 04:10:08.000000', 'Thank you, i think this should resolve my problem, even if in another way – \n', b'1', NULL, NULL, NULL, 1, 9),
('ReponsePublication', 15, '2024-05-08 04:10:48.000000', '0\n\nYou can set the \"day of month\" field to the range 2-31, effectively excluding the first day. This should do it:\n\n50 3 2-31 * 2 MyCommand', b'1', NULL, NULL, NULL, 2, 9);
